sys_variable_value.value:
(function execute(inputs, outputs) {
  var region = inputs.Region.trim();
  var session = gs.getSession();
  session.putClientData('SN_AWS_LOAD_BALANCING_REGION', region || "us-east-1");
  session.putClientData("SN_AWS_LOAD_BALANCING_FILTER", null);
  outputs.region = region;
  outputs.load_balancer_arn = inputs.Load_balancer_arn.trim()
  outputs.protocol = inputs.protocol.trim()
  outputs.port = inputs.port.trim()
  outputs.action = inputs.action.trim()
  outputs.target_group_arn = inputs.target_group_arn.trim()
  outputs.certificate_arn = inputs.certificate_arn.trim()
  outputs.ssl_policy = inputs.ssl_policy.trim()
})(inputs, outputs);

